import React from 'react'
import { Link, useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();
  const goLoginPage = () => {
    navigate('/login');
  }

  return (
    <>
      <h1>BOX</h1>
      <button onClick={goLoginPage}>로그인</button>
      <Link to="/join">가입하기</Link>
    </>
  )
}

export default Home
